@section('scripts')
    <script>
        var header = $('.blurry-backgorund');
        var $window = $(window);
        header.addClass('mainPage-navbar');
        $('.white-icon').removeClass('d-none');
        $('.dark-icon').addClass('d-none');
        $window.on('scroll', function () {
            var scroll = $window.scrollTop();
            if (scroll < 400) {
                header.addClass('mainPage-navbar');
                $('.white-icon').removeClass('d-none');
                $('.dark-icon').addClass('d-none');
            } else {
                header.removeClass('mainPage-navbar');
                $('.white-icon').addClass('d-none');
                $('.dark-icon').removeClass('d-none');
            }
        });
        let nextButton = document.getElementById('next');
        let prevButton = document.getElementById('prev');
        let carousel = document.querySelector('.carousel');
        let listHTML = document.querySelector('.carousel .list');
        let seeMoreButtons = document.querySelectorAll('.seeMore');
        let backButton = document.getElementById('back');

        nextButton.onclick = function () {
            showSlider('next');
        }
        prevButton.onclick = function () {
            showSlider('prev');
        }
        let unAcceppClick;
        const showSlider = (type) => {
            nextButton.style.pointerEvents = 'none';
            prevButton.style.pointerEvents = 'none';

            carousel.classList.remove('next', 'prev');
            let items = document.querySelectorAll('.carousel .list .item');
            if (type === 'next') {
                listHTML.appendChild(items[0]);
                carousel.classList.add('next');
            } else {
                listHTML.prepend(items[items.length - 1]);
                carousel.classList.add('prev');
            }
            clearTimeout(unAcceppClick);
            unAcceppClick = setTimeout(() => {
                nextButton.style.pointerEvents = 'auto';
                prevButton.style.pointerEvents = 'auto';
            }, 500)
        }
        seeMoreButtons.forEach((button) => {
            button.onclick = function () {
                carousel.classList.remove('next', 'prev');
                carousel.classList.add('showDetail');
            }
        });
    </script>
@endsection
